export default function EmpAction()
{
   
    return({
        type:'EmpAction',

        payload:[
            {
                id:1,
                name:'balu',
                email:'balu@gmail.com'
            },
            {
                id:2,
                name:'abhi',
                email:'abhi@gmail.com'
            },
            {
                id:3,
                name:'virat',
                email:'viart@gmail.com'
            }
        ]
    })
}
